INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (1, 0, 0, 16612036, 10, 0.5, 11, 1, "あははっ！　そういうエリコ様も\nおててが絵の具だらけでござるよ～！\nむふふ、いわゆるギャップ萌え\nというやつですな？", 101311, 16612);
